import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";

export default function Product() {
    let { slug } = useParams();
  return (
    <>
        <div>
        <h3>ID: {slug}</h3>
        </div>
    </>
  );
}
